import { Table } from 'react-bootstrap';
import { useSelector } from 'react-redux';

function Cart() {
    let a = useSelector((state) => { return state.user })
    let carts = useSelector((state) => { return state.cartData })

    return (
        <Table>
            <thead>
                <tr>
                    <th>#</th>
                    <th>상품명</th>
                    <th>수량</th>
                    <th>변경하기</th>
                </tr>
            </thead>
            <tbody>
                {
                    carts && carts.map(function (cart, idx) {
                        return (
                            <tr>
                                <td>{ cart.id }</td>
                                <td>안녕</td>
                                <td>안녕</td>
                                <td>안녕</td>
                            </tr>
                        )
                    })
                }
                <tr>
                    <td>1</td>
                    <td>안녕</td>
                    <td>안녕</td>
                    <td>안녕</td>
                </tr>
            </tbody>
        </Table>
    )
}

export default Cart;
